import { Stack, Typography, Button, TextField, Box } from "@mui/material";

import PlayArrowIcon from '@mui/icons-material/PlayArrow';

const Form = () => {
    return (
        <Stack> 
            <TextField>Number of Questions</TextField>
            <TextField>Category</TextField>
            <TextField>Difficulty</TextField>
            <TextField>Type</TextField>


        </Stack>
    );
};

export default Form;
